window.bookSummaryJSON = "<p>Enki Zakanin just wants peace and quiet. He's completed his mission, and on the journey back to the Kordolian Fleet Station, he'd prefer to be left alone so he can manage the literal demon inside his head. Alone.</p> <p>So when a strange distress call breaks the silence, his first instinct is to ignore the signal. Why would anyone be foolish enough to broadcast an open signal in the Ninth?</p> <p><i>My name is Layla dela Cruz. I need your help.</i></p> <p>A human? What in Kaiin's Hells is she doing this far into Sector Nine? Now, somehow, he has to go and get her. After all, he's given her his word.</p> <p>Contains mature themes.</p>"; 
